String.prototype.RouterReset = function(){
    var name = String(this); 
    app.views.main.router.history=[name];
};
function RouterReset(name){

    app.views.main.router.history=typeof name=="string"?[name]:name;
}
function goto(name,data){
    var url =getRouter(name);
    if(url){
        url.navigate(data||{});
    }
}
 
function addRoute(options){
    // var a = options.on;
    // options.name = a.name;
    // options.on = a.o;
    if(!window.routes){
        window.routes = [];
    }
    window.routes.push(options);

    return new Promise(function(a,b){
        a();
    });
}

function getRouter(/*name|url,...args*/){
   var args = Array.prototype.slice.call(arguments, 1);
   var name = arguments[0];
   if(app){
     var routers =  app.views.main.routes.filter(function(v){
       if(v.name==name){
          return true;
       }
     });


     if(routers.length){
        routers = routers.pop();
        
       var c =0;

       var url= routers.path.replace(/(:[a-z]+)/ig,function(v,index){
         return args[c++]||v;
       });
       
     
       return url;
       
     }

   }
   return name;
}

String.prototype.getRouter = function(){
   var args = Array.prototype.slice.call(arguments, 0);
   args.unshift(this.toString());
   return getRouter.apply(this,args);
};

String.prototype.route =function(name,url, ignoreCache){
    var a = this.toString();
    if(a[a.length-1]!="/"){
        a = a+"/";
    }
  return addRoute({
        name:name,
         ignoreCache: ignoreCache||false,
        path: a,
        url:url.startsWith("http")?url:site_url(url),
        on: (function(){
            var a = AEventPage(name);

            return a.o;
        })()
  });
};
String.prototype.routeRuntime = function(name,options) {
    var a = this.toString();
    if(!window.mainView){
        setTimeout(function(){
            a.routeRuntime(name,options);
        },2000);
        return;
    }
    
    if (a[a.length - 1] != "/") {
        a = a + "/";
    }
    if(!options)options={};


    options.name = name;
    options.path = a;
    //options.url = a;
    options.ignoreCache = options.ignoreCache||false;
    if(!options.on){
        options.on = (function() {
            var a = AEventPage(options.name);

            return a.o;
        }
        )();
    }
    if(options.html){
        (function(html){
            options.async = function (routeTo, routeFrom, next, reject) {
                if(typeof html=="function"){
                    html(function(str){
                         next( {
                            content: str
                          },
                         
                          {
                            context: {
                              users: window.user.hasLogin()||{},
                            },
                          }
                        );
                    });
                }else{
                    next( {
                        content: html
                      },
                     
                      {
                        context: {
                          users: window.user.hasLogin()||{},
                        },
                      }
                    );
                }
                 
            };
        })(options.html);
        delete options.html;
         
        
    }

    mainView.routes.push(options);

    if(options.onReady){
        options.onReady(window,options.name);
    } 
};
