$(document).on('click','[data-back]',function(){
    var r = $(this).attr('data-back');
    if(r){
        r.navigate($(this).data());
    }else if(app){
        app.router.back();
    }
});
function goBack() {
    if(app){
        app.router.back();
    }
}
